Text:
@Wullie7362

You dont understand bandwidth terms, Your ISP advertises your maximum download speed in Megabits per second (mbps), utorrent and other programs usually measure it in Megabytes per second (MB/s) Notice the capitalised B. 

There are 8 bits in a byte and therefore you have to multiply yoiur MB/s speed by 8 to get the mbps speed. 8mbps is actually 1MB/s. your 3.7MB/s is 29.6mbps. you still dont get max speed but some drop is expected. i get 37mbps on BT Infinity.
